import { useState, useEffect } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import {format} from 'date-fns';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "./itemForm.css";
import Form from 'react-bootstrap/Form';

const ItemForm = () => {

	return (
        <>
            <div className="container d-flex col-8 offset-2 mt-5 main-container flex-column">
                <h1 className="d-flex col-12 justify-content-center mt-2 font-white">Add Item</h1>
                <hr></hr>
                <Form className="d-flex col-12 flex-column">
                    <Form.Group className="mb-3 d-flex col-12" controlId="exampleForm.ControlInput1">
                        <Form.Label className="col-3">Email address</Form.Label>
                        <Form.Control className="col-7 form-control-sm" type="email" placeholder="name@example.com" />
                    </Form.Group>
                    <Form.Group className="mb-3 col-12" controlId="exampleForm.ControlTextarea1">
                        <Form.Label>Example textarea</Form.Label>
                        <Form.Control as="textarea" rows={3} />
                    </Form.Group>
                </Form>
            </div>
        </>
	);
};

export default ItemForm;
